import React, {FC, ReactElement, useEffect, useState} from "react";
import "./style.sass";
import {DashboardHeader} from "./components/header";
import {DashboardFooter} from "./components/footer";
import {CarouselComp} from "./components/carousel";
import GlideComponent from "./components/Images_Glide";


export const MainDashboard: FC = (): ReactElement => {


    // useEffect(() => {
    //     async function fetchData() {
    //         const response = await axios.get('http://localhost:3300/entitiesCount');
    //         setData(response.data);
    //     }
    //     fetchData();
    // }, []);

    return (
          <div className="container-xxl p-0">
              <DashboardHeader/>
              <CarouselComp/>
              <div className="container-fluid booking pb-5 wow fadeIn" data-wow-delay="0.1s">
                  <div className="container">
                      <div className="bg-white shadow" style={{padding: '35px'}}>
                          <form>
                              <div className="row g-2">
                                  <div className="col-md-10">
                                      <div className="row g-2">
                                          <div className="col-md-3">

                                          </div>
                                          <div className="col-md-3">

                                          </div>
                                          <div className="col-md-3">
                                              <select className="form-select" >
                                                  <option value="Adult">Adult</option>
                                                  <option value="Adult 1">Adult 1</option>
                                                  <option value="Adult 2">Adult 2</option>
                                                  <option value="Adult 3">Adult 3</option>
                                              </select>
                                          </div>
                                          <div className="col-md-3">
                                              <select className="form-select" >
                                                  <option value="Child">Child</option>
                                                  <option value="Child 1">Child 1</option>
                                                  <option value="Child 2">Child 2</option>
                                                  <option value="Child 3">Child 3</option>
                                              </select>
                                          </div>
                                      </div>
                                  </div>
                                  <div className="col-md-2">
                                      <button type="submit" className="btn btn-primary w-100">Submit</button>
                                  </div>
                              </div>
                          </form>
                      </div>
                  </div>
              </div>
              {/*<GlideComponent/>*/}
              <DashboardFooter/>
          </div>
    )
};
